import React, { useEffect, useState } from 'react'

export const Hooksproject = () => {
    const [user,setUser] =useState([]);
    const getUser=async ()=>{
     const res=await fetch('https://api.github.com/users');
     setUser(await res.json());
    }
    useEffect(()=>{
     getUser();   
    },[]);
  return (
    <>
  <h2>List of user</h2>
  <div className='container-fluid mt-5'></div>
  <div className="row">
    {
        user.map((current)=>{
          return(
            <div>
                <div className="container" key={current.id}>
                    <div className="row">
                        <div className="login">{current.login}</div>
                    </div>
                </div>
            </div>
          )
        })
    }
  </div>
    </>
  )
}
